Jenaveve Jolie - Blind, Deaf and Cum

Added: June 03, 2010

James brings his girlfriend to the hospital after she mysteriously goes blind, deaf and mute. After describing the events that led up to the accident, Dr. Jolie's diagnosis is that it's a rare case of &quot;shock-gasm&quot;, a state of shock that only occurs when the female undergoes the rawest, nastiest sex.
